import { StyleSheet, Text, View } from "react-native";
import React from "react";

const ExploreScreen = () => {
  return (
    <View>
      <Text>ExploreScreen</Text>
    </View>
  );
};

export default ExploreScreen;

const styles = StyleSheet.create({});
